import React, { useState, useEffect } from 'react';
import meter2 from "../assets/img/Nathan-Team22.png";
import meter1 from "../assets/img/Philippe-Team.png";
import meter3 from "../assets/img/Killian-Team.png";
import meter4 from "../assets/img/Maxime-Team.png";
import meter5 from "../assets/img/Isaak-Team.png";
import meter6 from "../assets/img/Clement-Team.png";
import meter7 from "../assets/img/Quentin-Team.png";
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import arrow1 from "../assets/img/arrow1.svg";
import arrow2 from "../assets/img/arrow2.svg";
import colorSharp from "../assets/img/color-sharp.png";
import colorSharpR from "../assets/img/color-sharp-right.png";

export const Skills = () => {
  const [slideIndex, setSlideIndex] = useState(0);

  const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
  };


  useEffect(() => {
    console.log("slide Index Next 2 -->", slideIndex);
  }, [slideIndex]); // Dependency array ensures useEffect runs when slideIndex changes

  const handleNextClick = () => {
    setSlideIndex(slideIndex + 1);
  };

  const handlePrevClick = () => {

      console.log("slide Index Previous --> %d",slideIndex)

      setSlideIndex(slideIndex - 1);
      console.log("slide Index --> %d",slideIndex)

  };

  const ButtonGroup = ({ next, previous, goToSlide, ...rest }) => {
    const { carouselState: { currentSlide } } = rest;
    return (
      <div className="carousel-button-group"> // remember to give it position:absolute
      <button className="react-multiple-carousel__arrow react-multiple-carousel__arrow--left" onClick={() => { 
          handlePrevClick(); 
          previous(); 

      }}></button>

      <button className="react-multiple-carousel__arrow react-multiple-carousel__arrow--right" onClick={() => {handleNextClick(); next(); }}></button>
      </div>
    );
  };


  const renderText = (currentSlide) => {
    switch (currentSlide) {
      case 0:
        return "Nathan SABOURDY";
      case 1:
        return "Killian DESSERICH";
      case 2:
        return "Maxime ROTH-FESSLER";
      case 3:
        return "Isaak NICOLAS";
      case 4:
        return "Clément BERNAT";
      case 5:
        return "Quentin ROUVIER";
      case 6:
        return "Philippe CHEYPE";
      default:
        return ""; // Add default case to handle unexpected values
    }
  };

  return (
    <section className="skill" id="team">
      <div className="container">
        <div className="row">
          <div className="col-12">
            <div className="skill-bx wow zoomIn">
              <h2>Equipe</h2>
              <h2 style={{ color: 'black' }}>{renderText(slideIndex)}</h2>

              <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.<br></br> Lorem Ipsum has been the industry's standard dummy text.</p>
              <Carousel responsive={responsive} infinite={true} className="owl-carousel owl-theme skill-slider" arrows={false} customButtonGroup={<ButtonGroup />}>
                <div className="item">
                  <img src={meter1} alt="Image" />
                  <h5>Web Development</h5>
                </div>
                <div className="item">
                  <img src={meter2} alt="Image" />
                  <h5>Brand Identity</h5>
                </div>
                <div className="item">
                  <img src={meter3} alt="Image" />
                  <h5>Logo Design</h5>
                </div>
                <div className="item">
                  <img src={meter4} alt="Image" />
                  <h5>Web Development</h5>
                </div>
                <div className="item">
                  <img src={meter5} alt="Image" />
                  <h5>Web Development</h5>
                </div>
                <div className="item">
                  <img src={meter6} alt="Image" />
                  <h5>Web Development</h5>
                </div>
                <div className="item">
                  <img src={meter7} alt="Image" />
                  <h5>Web Development</h5>
                </div>
              </Carousel>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};
